  getBase64ImageFromUrl(url: string): Promise<string> {
    return new Promise((resolve, reject) => {
      const canvas = document.createElement('canvas');
      const ctx = canvas.getContext('2d');
  
      if (!ctx) {
        reject(new Error('Failed to get canvas context'));
        return;
      }
  
      const img = new Image();
      img.crossOrigin = 'Anonymous';  
      img.onload = () => {
        canvas.width = img.width;
        canvas.height = img.height;
        ctx.drawImage(img, 0, 0);
        const dataURL = canvas.toDataURL('image/png');
        resolve(dataURL);
      };
      img.onerror = (error) => reject(error);
      img.src = url;
    });
  }
  
  addEvent() {
    if (this.newEvent.day && this.newEvent.start && this.newEvent.end && this.newEvent.matiere && this.newEvent.room && this.newEvent.group) {
      this._timetableService.checkRoomAvailability(this.newEvent.room, { emploiDateId: this.selectedDateRange, sessions: this.newEvent }).subscribe({
        next: (value) => {
          if (value.data === true) {
            this._timetableService.checkGroupAvailability(this.newEvent.group, { emploiDateId: this.selectedDateRange, sessions: this.newEvent }).subscribe({
              next: (groupValue) => {
                if (groupValue.data) {
                   Promise.all([
                    this._roomService.getRoomById(this.newEvent.room).toPromise(),
                    this._matiereService.getMatiereById(this.newEvent.matiere).toPromise(),
                    this._groupService.getGroupById(this.newEvent.group).toPromise()
                  ]).then(([room, matiere, group]) => {
                    this.events.push({ ...this.newEvent });
                    this.allNewEvents.push({
                      day: this.newEvent.day,
                      start: this.newEvent.start,
                      end: this.newEvent.end,
                      room: room.data,
                      matiere: matiere.data,
                      group: group
                    });
                    this.newEvent={} as Event
                  }).catch(err => {
                    console.error("Error fetching details:", err);
                    this.openErrorModal('Une erreur est survenue lors de la récupération des détails.');
                  });
                } else {
                  this.openErrorModal(groupValue.message);
                }
              },
              error: (err) => {
                console.log(err);
                this.openErrorModal('Une erreur est survenue lors de la vérification de la disponibilité du groupe.');
              }
            });
          } else {
            this.openErrorModal(value.message);
          }
        },
        error: (err) => {
          console.log(err);
          this.openErrorModal('Une erreur est survenue lors de la vérification de la disponibilité de la salle.');
        }
      });
    } else {
      this.openErrorModal('Veuillez vous assurer que tous les champs sont remplis avant d\'ajouter l\'événement.');
    }
  }
  
  
  
